INSERT INTO `baiviets` (`Id`, `Title`, `Image`, `Description`, `Content`, `Author`, `Hide`, `CreateDate`, `View`, `Id_TheLoaiTin`) VALUES
(1, 'Quy trình kỷ luật đảng viên thuộc thẩm quyền Trung ương Đảng, Bộ Chính trị, Ban Bí thư', 'https://i1-vnexpress.vnecdn.net/2024/06/16/img4961-1715834051707147918637-9026-7376-1718517809.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=oL4TTlvFflpICd4vbSucCg', 'Việc xem xét kỷ luật tổ chức đảng, đảng viên thuộc thẩm quyền của Ban Chấp hành Trung ương Đảng, Bộ Chính trị, Ban Bí thư sẽ thực hiện theo quy trình 3 bước.', 'z', 'Phạm Dự', 0, '16/06/2024', 0, 1),
(2, 'Bốn nguyên Chủ tịch tỉnh bị cảnh cáo', 'https://i1-vnexpress.vnecdn.net/2024/06/15/luuxuanvinh-1718428130-7095-1718428197.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=-WLYBqlJnBc0o6bciYhfTg', 'Nguyên Chủ tịch tỉnh Ninh Thuận, Bình Dương, Long An và Bà Rịa - Vũng Tàu bị Ủy ban Kiểm tra Trung ương cảnh cáo do vi phạm trong triển khai dự án, gói thầu.', 'z', 'Phạm Dự', 0, '16/06/2024', 0, 1),
(3, 'Đề nghị kỷ luật Phó ban Nội chính Trung ương Nguyễn Văn Yên', 'https://i1-vnexpress.vnecdn.net/2024/06/15/dscf7472-jpg-1718430620-171843-6564-4199-1718430842.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=6rcxeNXK7sgTD-PkTXjWVQ', 'Ủy ban Kiểm tra Trung ương đề nghị cấp có thẩm quyền xem xét, thi hành kỷ luật ông Nguyễn Văn Yên, Phó ban Nội chính Trung ương.', 'z', 'Phạm Dự', 0, '16/06/2024', 0, 1),
(4, 'Dỡ biệt thự nhường đất cho cao tốc', 'https://i1-vnexpress.vnecdn.net/2024/06/13/z5534349956352-ad741cc2d629640003b22626e36f4b18-1718268765.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=1EUTaJYy_4X04mGWecGorw', 'QUẢNG NGÃINhiều nhà cao tầng, biệt thự ở Ngã tư Quốc tế, huyện Tư Nghĩa, được tháo dỡ để bàn giao mặt bằng cao tốc Quảng Ngãi - Hoài Nhơn trước 30/6.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 2),
(5, 'Tiểu thương lao đao sau lũ \"chưa từng thấy\"', 'https://i1-vnexpress.vnecdn.net/2024/06/10/cho-1718011842-2375-1718011849.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=HMnZzHA2doOFWUlKv6-h4A', 'QUẢNG NINHTrận lũ lớn nhất từ trước tới nay ở chợ trung tâm Uông Bí khiến hàng trăm tiểu thương bị thiệt hại tài sản, phải tạm dừng kinh doanh.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 2),
(6, 'Thu hoạch lá thuốc bán dịp Tết Đoan Ngọ', 'https://i1-vnexpress.vnecdn.net/2024/06/06/quangnam-jpg-1717640928-1717641492.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=ibLdh4UgHpwtOnUahTTSxA', 'QUẢNG NAMNhững ngày này, nông dân ở xã Bình Đào, huyện Thăng Bình đội nắng thu hoạch cây thuốc nam để bán đun nước uống dịp Tết Đoan Ngọ.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 2),
(7, 'Số lao động rút bảo hiểm xã hội một lần tăng', 'https://i1-vnexpress.vnecdn.net/2024/06/14/BHXH-ThuDuc-TTung-11-3757-1718351929.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=KWVrvl1Edvn_g_sXgPbVXg', 'Gần 595.000 người rút bảo hiểm xã hội (BHXH) một lần từ đầu năm đến nay, tăng 3,8% so với cùng kỳ năm 2023, phần lớn là lao động 20-40 tuổi.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 3),
(29, 'Không chấm dứt được tình trạng rút BHXH với phương án cho nhận 50%', 'https://i1-vnexpress.vnecdn.net/2024/06/13/img-8682-jpg-1437-1718278893-1-8026-1637-1718282362.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=hH6kZwLTk2NZr6aqa_RAuQ', 'Cho lao động nhận 50% nhưng không giới hạn số lần rút sẽ khó chấm dứt tình trạng hưởng trợ cấp một lần, số tiền còn lại trong quỹ ít nên lương hưu không cao, theo BHXH TP HCM.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 3),
(30, 'Khánh thành đường nối An Giang - Cần Thơ', 'https://i1-vnexpress.vnecdn.net/2024/06/16/z5543307181165-4d4f6c8da3ca8d3-1726-7282-1718507631.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=ciYNZpCw2neD0nA-Y4DMew', 'Tuyến tránh Long Xuyên và nối quốc lộ 91 dài 15 km, kinh phí hơn 2.100 tỷ đồng, nối An Giang và Cần Thơ, hoàn thành sau hai năm rưỡi thi công, sáng 16/6.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 4),
(31, 'Người dân dỡ nhà, giao đất mở rộng đường cửa ngõ TP HCM', 'https://i1-vnexpress.vnecdn.net/2024/06/13/z5506500106777-83b138a866ed8014b85c0b1fe16da8b9-1718274863-1718284716.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=HHUif_Qd7NMbGq18jKqm_Q', 'Hàng loạt căn nhà bên đường Nguyễn Thị Định, TP Thủ Đức, được chủ hộ tháo dỡ, lùi vào trong để giao mặt bằng mở rộng tuyến lên 30 m giúp giảm ùn tắc, tai nạn.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 4),
(32, 'Nhà máy UAV Nga có thể định hình xung đột Ukraine', 'https://i1-vnexpress.vnecdn.net/2024/05/28/uav-ukraine-afp-1693282400-592-7463-5228-1716892657.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=-w9Qojw9bBgWnSfDnGQlHg', 'Nga xây cơ sở sản xuất UAV thuộc Đặc khu kinh tế Alabuga, áp dụng công nghệ Iran và thuê nhân lực châu Phi, với mục tiêu chế tạo 6.000 UAV tự sát.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 8),
(33, 'Tính toán khiến thủ lĩnh Hamas ở Gaza quyết đối đầu Israel', 'https://i1-vnexpress.vnecdn.net/2024/06/12/AFP2022100132KH7GRv2HighResPal-1420-4801-1718165072.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=-oimBHadL7oUSADUUKk92Q', 'Yahya Sinwar, thủ lĩnh Hamas ở Gaza, tin rằng khi thương vong dân thường tăng cao và giao tranh kéo dài, bên chịu thiệt lại nhiều hơn sẽ là Israel.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 8),
(34, 'Ông Macron có thể sai lầm trong ván cược với phe cực hữu', 'https://i1-vnexpress.vnecdn.net/2024/06/15/macron-1718429493-6203-1718429781.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=zIpO-fIjbod7dSWbEkFHmw', 'Tính toán chính trị của Tổng thống Pháp Macron khi tổ chức bầu cử sớm có thể phản tác dụng, khi thăm dò cho thấy phe cực hữu đang thắng thế.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 9),
(35, 'Cách phương Tây huy động 50 tỷ USD cho Ukraine từ tài sản Nga', 'https://i1-vnexpress.vnecdn.net/2024/06/14/afp-20240613-34wl8f9-v2-highre-7977-2277-1718358034.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=81oEbVzmEwQwLdrc3o-7Sg', 'Thay vì trực tiếp rút tiền từ hơn 300 tỷ USD bị đóng băng của Nga, phương Tây sẽ biến lãi suất thành khoản thế chấp để huy động 50 tỷ USD cho Ukraine.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 9),
(36, 'Kỳ vọng của Ukraine với hội nghị hòa bình ở Thụy Sĩ', 'https://i1-vnexpress.vnecdn.net/2024/06/14/afp-20240602-34up9vt-v4-highre-7852-7232-1718358966.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=85QdEPtXcM0KB8ZkvF3_NA', 'Ukraine kỳ vọng hội nghị thượng đỉnh ở Thụy Sĩ sẽ gây đủ áp lực buộc Nga chấm dứt xung đột, song giới quan sát không lạc quan về điều này.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 9),
(37, 'Nga kiểm soát thêm làng ở Zaporizhzhia', 'https://i1-vnexpress.vnecdn.net/2024/06/16/5563187178137268414a-nga-17185-4141-2537-1718554437.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=Q2fP-Cy3fT7kIwpRXDip_w', 'Bộ Quốc phòng Nga thông báo quân đội nước này kiểm soát làng Zagornoye ở tỉnh Zaporizhzhia và giành vị trí thuận lợi hơn trong khu vực.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 10),
(38, 'Mỹ tố chiến hạm Iran bỏ mặc thủy thủ tàu hàng bị Houthi tập kích', 'https://i1-vnexpress.vnecdn.net/2024/06/16/5563187178137268412a-iran-1718-4253-6300-1718539978.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=pXG8aXQ29oyII4nRnrWbew', 'Bộ tư lệnh Mỹ cho biết hộ vệ hạm Iran cách tàu Verbena gần 15 km, song không phản hồi tín hiệu cầu cứu từ các thủy thủ trên đó.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 10),
(39, 'Cơn nghiện nước tăng lực của lính Ukraine', 'https://i1-vnexpress.vnecdn.net/2024/06/12/5563187178137268148a-ukraine-1-2866-9868-1718155967.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=30MZmC2uTwIvNDumYw2y0A', 'Những lon nước tăng lực với khẩu hiệu yêu nước được ví như \"thuốc giải\" cho tình trạng căng thẳng mà lính Ukraine hứng chịu trong xung đột.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 10),
(40, 'Kinh tế Đức có thể hưởng lợi hơn 1 tỷ USD nhờ Euro 2024', 'https://i1-kinhdoanh.vnecdn.net/2024/06/16/ap2416670938235017184211321733-4063-3072-1718524813.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=AP3w1FNoGAyRZX7Igdc_-Q', 'Euro 2024 được dự báo mang về 1,07 tỷ USD cho kinh tế Đức, nhờ du khách đến quốc gia này xem bóng đá.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 11),
(41, 'Giá vàng thế giới tăng mạnh', 'https://i1-kinhdoanh.vnecdn.net/2024/06/15/gold4-1718416574-7676-1718416692.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=qegCQ9MdU5mLz_BvA50Ptw', 'Lạm phát Mỹ hạ nhiệt và chứng khoán châu Âu bị bán tháo kéo giá vàng tăng 1% trong phiên cuối tuần.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 11),
(42, 'Doanh nghiệp thu 10,2 tỷ đồng mỗi ngày nhờ gửi ngân hàng 2,4 tỷ USD', 'https://i1-kinhdoanh.vnecdn.net/2024/06/16/vnpt-jpeg-1718515130-7791-1718515445.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=-_lwOW7eO8u8Jjiq7b3XFA', 'Với gần 61.000 tỷ tiền mặt và khoản tương đương tiền, VNPT gửi ngân hàng và thu 3.739 tỷ đồng lãi từ nhà băng năm 2023, tức mỗi ngày thu 10,2 tỷ đồng.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 12),
(43, 'Viettel nhận 10 giải thưởng Tuổi trẻ sáng tạo trong quân đội', 'https://i1-kinhdoanh.vnecdn.net/2024/06/16/anh2-1718509026-1718509045-1195-1718509084.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=7ehJKufebDv9xYeqsDWF0A', 'Tập đoàn Công nghiệp – Viễn thông Quân đội nhận 1 giải nhất, 4 giải nhì, 4 giải ba và 1 giải khuyến khích tại sự kiện lần thứ 24 của Bộ Quốc phòng, hôm 11/6.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 12),
(44, 'Ba nhà đồng sáng lập Nobu Hospitality sắp đến Việt Nam', 'https://i1-kinhdoanh.vnecdn.net/2024/06/16/image-extractword-1-out-6420-1-9412-6803-1718501633.png?w=240&h=144&q=100&dpr=1&fit=crop&s=GlgAWYLdISH-bgACzPr_HA', 'Nobu Matsuhisa, Robert De Niro và Meir Teper dự kiến có mặt tại TP HCM và Đà Nẵng từ ngày 18/6, để tham gia loạt sự kiện độc quyền của VCRE.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 12),
(45, 'VN-Index tuột mốc 1.300 điểm', 'https://i1-kinhdoanh.vnecdn.net/2024/06/14/QUYN8923-1718353675-4099-1718353733.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=WTS0nWni5Np9mcyxoTDlpA', 'Áp lực bán tăng vọt trong ít phút cuối phiên 14/6 khiến VN-Index giảm hơn 20 điểm, mất mốc 1.300 điểm.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 13),
(46, 'Chứng khoán trở lại sắc đỏ', 'https://i1-kinhdoanh.vnecdn.net/2024/06/11/app-entrade-x-by-dnse-17180949-4456-9126-1718094957.png?w=240&h=144&q=100&dpr=1&fit=crop&s=mGVm0Xi7l6RAQraeUxx4DQ', 'Ở phiên thứ năm kiểm tra mốc kháng cự quan trọng 1.300 điểm, VN-Index tiếp tục hạ khi áp lực bán thường trực, đẩy chứng khoán giảm hơn 6 điểm.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 13),
(47, 'Manulife: Người Việt lo lắng về ung thư, đột quỵ', 'https://i1-kinhdoanh.vnecdn.net/2024/06/12/HINH-MINH-HOA-8432-1718185951.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=1uHQnvRAeUEEcGqBkNhVWQ', '39% người được khảo sát lo lắng về ung thư và đột quỵ - con số cao nhất trong khảo sát Manulife Asia Care 2024 thực hiện đầu năm nay.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 14),
(48, 'Vì sao nên tham gia bảo hiểm nhân thọ?', 'https://i1-kinhdoanh.vnecdn.net/2024/04/17/1-1-4082-1657511773-1713346628-5437-2751-1713346728.png?w=240&h=144&q=100&dpr=1&fit=crop&s=JBRHLeDJpFQBQmRhnUO5og', '66% người tham gia bảo hiểm nhân thọ với mục đích phòng tránh rủi ro sức khỏe, bên cạnh lý do dự phòng tài chính theo khảo sát trên Survey True.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 14),
(49, 'FWD truyền cảm hứng qua chiến dịch \"Time to play\"', 'https://i1-kinhdoanh.vnecdn.net/2024/04/08/1-1712545276-3405-1712545386.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=DF8Mh1CuGtv2fkVE54jYhQ', 'FWD Việt Nam ra mắt chiến dịch \"Sống đầy cùng FWD - Bảo hiểm dễ hiểu\" (Time to play), khuyến khích mọi người đừng trì hoãn, sống trọn vẹn đam mê ngay hôm nay.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 14),
(50, 'Giá vải thiều cuối vụ tăng vọt', 'https://i1-kinhdoanh.vnecdn.net/2024/06/16/vai-1718508272-1718508372-6403-1718508873.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=B2eb_U24wivSSuFFlRXXFw', 'Năm ngoái, vải thiều truyền thống giá bán tại các cửa hàng chỉ 35.000-60.000 đồng, nhưng năm nay giá 100.000-180.000 đồng một kg.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 15),
(51, '250.000 đồng một kg ếch òn Ninh Thuận', 'https://i1-kinhdoanh.vnecdn.net/2024/06/16/ech-on-jpeg-1718500432-1718500-6281-2702-1718500519.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=GSr002ycuKHBhcaCiWLDIA', 'Ếch òn, đặc sản Ninh Thuận, được săn lùng dù giá 250.000 đồng một kg, cao gấp 2-3 lần năm ngoái và đắt hơn loại ếch thường.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 15),
(52, 'Đề xuất nước ngọt chịu thuế tiêu thụ đặc biệt 10%', 'https://i1-kinhdoanh.vnecdn.net/2024/06/14/130481679562033-1718350349-171-3754-7624-1718350852.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=SekvPvEkYBUIgf_KnJkSgA', 'Trong dự thảo mới nhất, Bộ Tài chính đề xuất áp thuế tiêu thụ đặc biệt với nước giải khát có đường ở mức 10%.', 'z', 'Phạm Linh', 0, '16/06/2024', 0, 15),
