(118, 'Có nên tắm ngay sau khi tập thể dục?', 'https://i1-suckhoe.vnecdn.net/2024/06/18/tam-1718718665-8595-1718718779.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=1wmb93GU45xk0lXHmNoycQ', 'Cơ địa tôi dễ ra nhiều mồ hôi nên có thói quen tắm sau khi tập thể dục, việc này có nên không? (Hùng, 30 tuổi, TP HCM)', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 43),
(119, 'Nằm ngủ điều hòa quá lâu có gây hại?', 'https://i1-suckhoe.vnecdn.net/2024/06/19/steps-to-follow-before-you-tur-8648-3093-1718763994.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=51Du9gc4_NyblmpT_39gsg', 'Trời nắng nóng, nhà tôi bật máy lạnh liên tục, xuyên đêm, vậy nằm ngủ điều hòa lâu có gây hại? (Trang, 34 tuổi, Hà Nội)', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 43),
(120, 'Có nên vo kỹ gạo đến khi nước trong?', 'https://i1-suckhoe.vnecdn.net/2024/06/18/anhmanhinh20240416luc153430-17-7487-9716-1718684546.png?w=680&h=408&q=100&dpr=1&fit=crop&s=q807TRRdLzMx-PVSLw_GBQ', 'Tôi thường vo kỹ gạo đến khi nước trong vì nghĩ sẽ giúp loại bỏ vi khuẩn, nhưng mẹ chồng tôi nói điều này làm gạo mất đi dưỡng chất. Vậy nên vo gạo thế nào? (Liên, 29 tuổi, Thái Bình)', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 44),
(121, 'Có nên dùng dầu dừa nấu ăn?', 'https://i1-suckhoe.vnecdn.net/2024/06/12/oil-1718190381-1718190399-4690-1718191224.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=SXgyLVdfzJbWY5UI0yt-uA', 'Tôi rất thích mùi vị của dầu dừa, có nên dùng loại dầu này nấu ăn hàng ngày không? (Ngân, 30 tuổi, TP HCM)', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 44),
(122, 'Vin Hy tổ chức hội thảo ứng dụng Vmat Pro sóng xung kích', 'https://i1-suckhoe.vnecdn.net/2024/06/19/image003-1718771408-5734-1718771478.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=0hHACjkLkcC7V0GRtmSlog', 'Vin Hy kết hợp thương hiệu Termosalud tổ chức gala vinh danh khách hàng, kết hợp hội thảo công nghệ Vmat Pro sóng xung kích, tại TP HCM, ngày 15/6.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 45),
(123, 'Phòng khám da liễu Ánh Tú mừng một năm thành lập', 'https://i1-suckhoe.vnecdn.net/2024/06/19/mia-7234-edit-1718783537-2015-1718783719.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=8w7HrYbW9Iq-zax-n5LM2Q', 'Hơn 150 khách mời dự tiệc kỷ niệm một năm thành lập Phòng khám Da liễu Ánh Tú tại khách sạn Intercontinenttal, TP HCM, ngày 16/6.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 45),
(124, '11 thực phẩm giúp bổ thận tráng dương', 'https://i1-suckhoe.vnecdn.net/2024/06/18/1-1718723258-1301-1718723269.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=R4mo7bH9HsTOC8Mgjtw7BA', 'Hàu, cá hồi, trứng gà hay táo, bơ, dưa hấu... là những thực phẩm tốt cho sinh lý, nam giới nên thường xuyên sử dụng trong thực đơn ăn uống hàng ngày.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 46),
(125, 'Đàn ông ăn lựu có bị vô sinh?', 'https://i1-suckhoe.vnecdn.net/2024/06/06/freshpomegranateswholeslice808-7197-7929-1717645177.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=PPu1m5zaUk2xzxdpqRoJFw', 'Nhiều người cho rằng nam giới không nên ăn lựu do gây giảm chức năng tình dục, thậm chí vô sinh, có đúng không? (Ngọc, 27 tuổi, Hà Nội).', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 46),
(126, 'Trầm cảm sau sinh', 'https://i1-suckhoe.vnecdn.net/2024/06/18/anhmanhinh20240329lu2657245817-2426-6574-1718714958.png?w=680&h=408&q=100&dpr=1&fit=crop&s=lw5gCgwhpZ_1fpz0_F9hdA', 'Trầm cảm sau sinh là tâm lý mệt mỏi, buồn chán, lo lắng xuất hiện sau khi sinh, thường kèm nỗi lo sợ con sẽ bị hại và bản thân mình là người mẹ xấu.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 47),
(127, 'Chuyển vạt da vá vết loét lộ xương', 'https://i1-suckhoe.vnecdn.net/2024/06/20/bstt-1718874586-7339-1718874647.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=deztB6eF_q-tSrBJROIkEA', 'TP HCM - Ông Donald, 83 tuổi, bị chấn thương phải nằm một chỗ nên loét da, hoại tử khoảng 20 cm, lộ gân và xương, được bác sĩ phẫu thuật chuyển vạt da vá lại.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 47),
(128, 'Điều ít biết về bốn vaccine xuất xứ Nga', 'https://i1-suckhoe.vnecdn.net/2024/06/20/THUMB-vac-xin-bai-liet-2-1992-1718874007.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=4Egsz-cK7mdc8HYSIaaugg', 'Vaccine Sabin góp phần giúp Việt Nam \"thanh toán bại liệt\" năm 2000, Sputnik V phòng Covid-19, EnceVir ngừa sốt ve mò đều có xuất xứ từ Nga.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 48),
(129, 'Người trẻ Trung Quốc chuộng quan hệ hời hợt', 'https://i1-giadinh.vnecdn.net/2024/06/20/342b2e167e224c889397bd7333a6bd-8651-3922-1718858940.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=aS0DRvdR1NA-RNK7r-GgHw', 'Thay vì thiết lập mối quan hệ sâu sắc, gắn bó lâu dài, nhiều người trẻ lại chọn \"giao tiếp nhẹ nhàng\", đề cao sự đơn giản và thoải mái. ', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 49),
(130, 'Thanh niên Ấn Độ bế tắc tìm bạn đời', 'https://i1-giadinh.vnecdn.net/2024/06/07/screen-shot-2024-06-07-at-02-0-4379-1276-1717703118.png?w=240&h=144&q=100&dpr=1&fit=crop&s=O8S_LvstubHjz5xY0gGIEA', 'Chiều cuối tháng 4, Bhushan Unde cùng nhóm thanh niên ngồi trên băng ghế ở làng Raveri để xem bức ảnh chế \'tự cưới chính mình\' trên Instagram.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 49),
(131, 'Chú rể khóc vì mẹ đã mất \'xuất hiện\' trong đám cưới', 'https://i1-giadinh.vnecdn.net/2024/06/18/photo-1718671504-7648-1718677570.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=N699SMSBYt4Irnm_Cf-7SQ', 'TRUNG QUỐC Trong hôn lễ hôm 9/6, khi hình ảnh mẹ bất ngờ xuất hiện trên màn hình cùng những lời dặn dò thân thương, chú rể Trương Kiến Sơn đã không thể cầm nước mắt.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 50),
(132, 'Chuyện tình sóng gió của cô gái tí hon', 'https://i1-giadinh.vnecdn.net/2024/06/19/440967833-1887135975138859-164-9892-8847-1718731393.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=_Sk-7syuXgLimm8W7At98g', 'BẮC NINH - Ksor H Nuăi sinh ra bình thường nhưng cơ thể dừng phát triển từ năm 8 tuổi với chiều cao 1,26 m nên nghĩ việc lấy chồng, sinh con là ước mơ xa vời.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 50),
(133, '5 nguyên nhân khiến nảy sinh ngoại tình', 'https://i1-giadinh.vnecdn.net/2024/06/19/screen-shot-2024-06-19-at-13-2-3063-6953-1718814053.png?w=680&h=408&q=100&dpr=1&fit=crop&s=vSfDsZprtUD84Wpp6iD8Qw', 'Báo cáo của Hiệp hội tư vấn hôn nhân và gia đình Mỹ cho thấy 15% phụ nữ và 25% đàn ông thừa nhận từng ngoại tình.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 51),
(134, 'Vì sao nên làm bạn trước khi nhận lời yêu?', 'https://i1-giadinh.vnecdn.net/2024/06/19/shutterstock1514254784-1718785-5154-1418-1718785405.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=IwMzXXJNt-k7l7pehCw7Wg', 'Áp lực tìm một người yêu hoặc do thôi thúc của hormone có thể khiến bạn vội vã bỏ qua những bước quan trọng, một trong số đó là tìm hiểu đối tác.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 51),
(135, 'Mẹo khử mùi hôi nhà vệ sinh trong mùa nóng', 'https://i1-giadinh.vnecdn.net/2024/06/19/ta-i-xuo-ng-jpeg-9242-17183396-8896-5876-1718771430.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=Nb6Hz0TtfHhVM5iNG6iXeg', 'Thời tiết ngày càng nóng bức, không chỉ có nhiều muỗi hơn mà nhà vệ sinh cũng ngày càng nặng mùi hơn, làm giảm chất lượng cuộc sống của bạn.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 52),
(136, 'Chuyên gia Nhật chỉ 4 sai lầm càng dọn nhà càng bẩn', 'https://i1-giadinh.vnecdn.net/2024/06/17/20220122-atliving-fukisouji-ma-8043-1665-1718592259.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=5TCaB8tILD3SmEOFHYdSdg', 'Những phương pháp vệ sinh quen thuộc như lau sàn nhà bằng giẻ ướt thực chất gieo rắc vi khuẩn, bụi bẩn, khiến nhà càng bẩn hơn.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 52),
(137, '6 điểm đến ở London hút fan Taylor Swift', 'https://i1-dulich.vnecdn.net/2024/06/20/mayfair-knightsbridge-86-768x5-3382-2513-1718888579.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=PC_y7i3Xj3FNv352QMC-pQ', 'Công viên, quán bar, khu phố mua sắm sầm uất ở London xuất hiện trong album của Taylor Swift là những điểm hút khách đến London mùa hè này.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 56),
(138, 'Show diễn kết hợp 12 loại hình nghệ thuật tại Sun World Ba Na Hills', 'https://i1-dulich.vnecdn.net/2024/06/19/sun-1718790465-1591-1718790509.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=UetiTKgdds-VmfLCdyFSOQ', 'ĐÀ NẴNG - Show Fairy Blossom (Khu vườn thần tiên) ra mắt tại Sun World Ba Na Hills từ ngày 16/6, với sự tham gia của hơn 200 nghệ sĩ và nhiều ngôi sao xiếc quốc tế.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 56),
(139, 'Những món ăn không nên bỏ qua khi đến Đà Nẵng', 'https://i1-dulich.vnecdn.net/2024/06/19/dn4-1718772964-1718773013.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=9-CnjF1dnIhvP4US5LcWiw', 'Đà Nẵng đang trong mùa cao điểm du lịch hè, với lễ hội pháo hoa quốc tế, những bãi biển đẹp, đa dạng hoạt động giải trí và nhiều món ngon.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 57),
(140, 'Gỏi bò vị phở trong nhà hàng Michelin ở Hà Nội', 'https://i1-dulich.vnecdn.net/2024/06/15/goibo5-1718453074-2438-1718453711.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=Tl1JqwH2dj7AoAQzK73SiA', 'Để làm mới món bò tartare đã quen thuộc trong ẩm thực Pháp, bếp trưởng Jean Francois Nulli nghĩ đến phở - đồ ăn Việt nổi tiếng khắp thế giới.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 57),
(141, 'Khách Việt chinh phục Lưỡi quỷ trong bão, tuyết', 'https://i1-dulich.vnecdn.net/2024/06/16/IMG-6971-copy-1718551692.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=Md1I_xivWXHIoayHQzRXJw', 'NA UY - Để đến được mỏm đá Lưỡi quỷ nổi tiếng, nam du khách Việt băng qua những con đường phủ tuyết, vách đá cheo leo và đối mặt với trận bão lớn bất chợt.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 58),
(142, 'Vietjet diễu hành carnival với thông điệp bảo vệ thiên nhiên', 'https://i1-dulich.vnecdn.net/2024/06/17/Picture18-1718618314.png?w=240&h=144&q=100&dpr=1&fit=crop&s=v6yNAcCXLekQ9RNANOMyrg', 'Vietjet tham gia đoàn diễu hành carnival tại Liên hoan du lịch biển Nha Trang, thiết kế xe với nhiều biểu tượng thiên nhiên, động vật hoang dã, ngày 14/6.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 58),
(143, 'AI của Google tạo âm thanh khớp với video', 'https://i1-sohoa.vnecdn.net/2024/06/20/GG-1718873595-3829-1718873599.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=4V_j8hzzz2FpdmwW_k4Jrg', 'Công nghệ V2A (Video-to-Audio) của Google DeepMind được đánh giá là \"mảnh ghép còn thiếu để sản xuất phim bằng AI\", khi có thể tạo âm thanh khớp với video.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 59),
(144, 'Công nghệ VAR tại Euro 2024 khác biệt thế nào', 'https://i1-sohoa.vnecdn.net/2024/06/19/1718226001628-646558be-5514-4a-2591-6778-1718788696.png?w=240&h=144&q=100&dpr=1&fit=crop&s=uGk_I1ajCT1yrdbP_YJQ_w', 'VAR tại Euro 2024 được bổ sung AI, giúp theo dõi bất kỳ chuyển động nhỏ nào của bóng và cầu thủ với thời gian xử lý nhanh gấp đôi so với ở World Cup 2022.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 59),
(145, 'Nokia 220 4G ‘cục gạch’ giá một triệu đồng', 'https://i1-sohoa.vnecdn.net/2024/06/20/DSC9443-1718881224.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=0Z6dZO7r8HAlU85nV-h41Q', 'Phiên bản Nokia 220 thế hệ 2024 mới bán tại Việt Nam có màn hình IPS 2,8 inch, cổng sạc USB-C, pin 1.450 mAh và kết nối 4G.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 60),
(146, 'iPad Pro M4 OLED - giữ vững ngôi vương máy tính bảng', 'https://i1-sohoa.vnecdn.net/2024/06/18/top.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=xw8fg44vvCI6OFp2GX_2TA', 'iPad Pro 2024 tiếp tục là tablet mạnh nhất thị trường nhờ chip M4 cùng nhiều nâng cấp khác như mỏng nhẹ hơn và màn hình OLED.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 60),
(147, 'Hướng dẫn đăng ký tạm trú online', 'https://i1-vnexpress.vnecdn.net/2024/06/20/IMG8781-1718848953-2711-1718849112.jpg?w=680&h=408&q=100&dpr=1&fit=crop&s=4LuHXvOILtOVEnDegU3zcQ', 'Người dân có thể thực hiện 5 bước trên Cổng dịch vụ công quốc gia hoặc VNeID để thực hiện khai báo đăng ký tạm trú online.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 61),
(148, 'Có 5 triệu đồng nên mua TV hay máy chiếu xem Euro 2024?', 'https://i1-sohoa.vnecdn.net/2024/06/18/DSC058211671634949-1718722188-9101-1718722217.png?w=240&h=144&q=100&dpr=1&fit=crop&s=LoMnR5oy9RYJEDJJMEdnhA', 'Vì tài chính eo hẹp, tôi đang phân vân giữa chọn một chiếc TV hay máy chiếu mini để xem bóng đá.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 61),
(149, 'Cuộc chiến SUV gầm cao cỡ B tầm giá 700 triệu đồng', 'https://i1-vnexpress.vnecdn.net/2024/06/20/Settop.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=8niEl0W_dxiLrLTLV7dhCA', 'Xforce Ultimate mới ra mắt cạnh tranh trang bị với Hyundai Creta cao cấp và Yaris Cross HEV.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 62);
INSERT INTO `baiviets` (`Id`, `Title`, `Image`, `Description`, `Content`, `Author`, `Hide`, `CreateDate`, `View`, `Id_TheLoaiTin`) VALUES
(150, 'Nhà ở lưu động - loại xe được ưa chuộng trên thế giới', 'https://i1-vnexpress.vnecdn.net/2024/06/20/Motorhome2-1718852242-2199-1718853023.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=9TRfHBf_42XjCvPEHu_5zA', 'Xe nhà ở lưu động có nhiều dạng khác nhau, có không gian sống và những trang bị phục vụ sinh hoạt hàng ngày.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 62),
(151, 'Web cá độ Euro 2024 xuất hiện trái phép trên App Store Việt Nam', 'https://i1-sohoa.vnecdn.net/2024/06/19/IMG-8243-9222-1718787423.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=0xc6Fw76a8-wfMFXkJxidQ', 'Lợi dụng mùa Euro, các ứng dụng mang vỏ bọc tiện ích được đưa lên kho ứng dụng Apple, nhưng bên trong là cá cược trái phép.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 59),
(152, 'Nvidia - từ ba lần suýt phá sản đến công ty giá trị nhất thế giới', 'https://i1-sohoa.vnecdn.net/2024/06/19/2018-01-08t064606z-2104981634-4357-1519-1718765256.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=AoEKFsZfUSPUms6U7bXAWA', 'Hơn 30 năm qua, những khoảnh khắc Nvidia bên bờ vực sụp đổ được cho là đã in sâu trong tâm trí CEO Jensen Huang như hình xăm logo trên cánh tay ông.', 'z', 'Phạm Linh', 1, '20/06/2024', 0, 59),
(153, 'Elon Musk: \'Tương lai sẽ không có chiếc điện thoại nào\'', 'https://i1-sohoa.vnecdn.net/2024/06/18/elon-musk-1718727239-171872736-5205-9712-1718727683.jpg?w=240&h=144&q=100&dpr=1&fit=crop&s=5L2kukuF1osDbZ1kDj5ZQw', 'Tỷ phú Elon Musk cho rằng trong tương lai, công nghệ chip não của Neuralink có thể thay thế hoàn toàn điện thoại.', 'z', 'Phạm Linh', 0, '20/06/2024', 0, 59),
(154, 'Phong cách ăn mặc của Mark Zuckerberg thay đổi thế nào', 'https://i1-sohoa.vnecdn.net/2024/06/19/zuck-1715760623709-9772-171576-4077-5369-1718775059.png?w=240&h=144&q=100&dpr=1&fit=crop&s=qVYwEn4ma6r1Sk_5oscB5g', 'Hơn 20 năm kể từ ngày thành lập Facebook, Mark Zuckerberg từ một người ăn mặc đơn giản dần trở nên có phong cách thời trang hơn.', 'z', 'Phạm Linh', 1, '20/06/2024', 0, 59),
(155, 'Bà Nguyễn Thanh Hải làm Trưởng ban Công tác đại biểu', 'https://i1-vnexpress.vnecdn.net/2024/06/26/80e9ccf50d51ae0ff740-171936560-6748-2299-1719365618.jpg?w=680&h=0&q=100&dpr=1&fit=crop&s=uuyYd7VxCn2eFBE_IEvDXQ', 'Ủy ban Thường vụ Quốc hội bổ nhiệm bà Nguyễn Thanh Hải, Ủy viên Trung ương Đảng, Ủy viên Ủy ban Thường vụ Quốc hội, giữ chức Trưởng ban Công tác đại biểu.', 'z', 'Phạm Dự', 1, '26/06/2024', 0, 1),
(156, 'Cải tạo hồ tôm bỏ hoang thành công viên đẹp nhất Phan Thiết', 'https://i1-vnexpress.vnecdn.net/2024/06/21/Ho-Van-Thanh-01-JPG-1479-1718905143.jpg?w=300&h=180&q=100&dpr=1&fit=crop&s=dm-k0nSWbePpQgQTvbww6A', 'BÌNH THUẬN - Hồ nước bỏ hoang rộng hơn 4 ha kề sông Cà Ty, phường Phú Tài, được cải tạo thành công viên đẹp nhất Phan Thiết, phục vụ người dân, du khách.', 'z', 'Phạm Linh', 1, '16/06/2024', 0, 2),
(158, 'Ôtô chở 48 người lao xuống vực', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1719830881/webtintuc/update%20%C3%94t%C3%B4%20ch%E1%BB%9F%2048%20ng%C6%B0%E1%BB%9Di%20lao%20xu%E1%BB%91ng%20v%E1%BB%B1c/gmqhhinvq4pgna86kwh9.jpg', 'ĐĂK NÔNG - Xe giường nằm chở 48 hành khách bất ngờ lao xuống vực đoạn qua đèo Cùi Chỏ, trên quốc lộ 28 khiến 4 người bị thương, chiều 1/7.', '<p>\n\n<span class=\"location-stamp\" style=\"margin: 0px 15px 0px 0px; text-rendering: optimizelegibility; text-transform: uppercase; letter-spacing: -0.5px; position: relative; font-family: arial; background-color: rgb(252, 250, 246); font-size: 18px; color: rgb(117, 117, 117) !important;\">ĐĂK NÔNG -</span><span style=\"color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246); font-size: 18px;\">Xe giường nằm chở 48 hành khách bất ngờ lao xuống vực sâu hơn 30 m, đoạn qua đèo Cùi Chỏ nằm trên quốc lộ 28 khiến 4 người bị thương nặng, chiều 1/7.</span>\n<br /></p>\r\n\n\r\n<p><span style=\"color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246); font-size: 18px;\"><br /></span></p>\r\n\n\n\n\r\n<p><span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">\n\n<em style=\"text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246); font-size: 14px;\">* Tiếp tục cập nhật</em>\n<br /></span></p>\r\n\n\r\n<p><span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\"><em style=\"text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246); font-size: 14px;\"><br /></em></span></p>\r\n\n\n\n\r\n<p style=\"text-align: center;\"><img src=\"https://i1-vnexpress.vnecdn.net/2024/07/01/449194819-7877353512378444-560-1215-2404-1719826402.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=qplRAjaT0GbXKPLbiipfdQ\" /><br /></p>\r\n\n\r\n<p>\n\n<span style=\"color: rgb(34, 34, 34); font-family: arial; text-align: left; background-color: rgb(252, 250, 246); font-size: 14px;\">Hiện trường xe khách rơi xuống đèo. Ảnh:&nbsp;</span><em style=\"text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; text-align: left; background-color: rgb(252, 250, 246); font-size: 14px;\">Người dân cung cấp</em></p>\r\n\n\n\n\r\n<p><span style=\" text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; font-size: 14px; text-align: left; background-color: rgb(252, 250, 246)\"><span style=\"font-size: 18px;\">Khoảng 13h, tài xế (50 tuổi) lái ôtô khách biển Bình Dương chạy trên quốc lộ 28, hướng tỉnh Lâm Đồng đi tỉnh Đăk Nông. Khi đến đoạn cua gấp trên đèo Cùi Chỏ, xã Quảng Khê, huyện Đăk Glong, xe bất ngờ lao xuống vực.</span>\n\n<br /></span></p>\r\n\n\r\n<p><span style=\" text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; font-size: 14px; text-align: left; background-color: rgb(252, 250, 246)\"><span style=\"font-size: 18px;\"><br /></span></span></p>\r\n\n\n\n\r\n<p style=\"text-align: center;\"><img src=\"https://i1-vnexpress.vnecdn.net/2024/07/01/449212132-122101071860387008-5-3882-6574-1719827355.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=KC53Ff3sE7oz4jxggcoqoQ\" /><br /></p>\r\n\n\n\n\r\n<p style=\"text-align: left;\">\n\n<span style=\"color: rgb(34, 34, 34); font-family: arial; text-align: left; background-color: rgb(252, 250, 246); font-size: 14px;\">Một nạn nhân được cảnh sát cõng lên khỏi vực. Ảnh:&nbsp;</span><em style=\"text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; text-align: left; background-color: rgb(252, 250, 246); font-size: 14px;\">Công an huyện Đăk Glong cung cấp</em>\n<br /></p>\r\n\n\n\n\r\n<p>\n\n<span style=\"color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246); font-size: 18px;\">Ông Trần Nam Thuần, Chủ tịch UBND huyện Đăk Glong, cho biết đây là đoàn khách du lịch khi tới khu vực trên thì tông vào dải phân cách rơi xuống vực. Trong số 48 người trên xe có 4 người bị đa chấn thương, gãy chân, tay đã được đưa về Bệnh viện tỉnh Đăk Nông chữa trị.</span>\n<br /></p>\r\n\n\r\n<p><span style=\"color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246); font-size: 18px;\"><br /></span></p>\r\n\n\n\n\r\n<p>\n\n<span style=\"color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246); font-size: 18px;\">Những người bị thương nhẹ đang được điều trị tại Tr</span><span style=\"background-color: rgb(252, 250, 246); color: rgb(34, 34, 34); font-family: arial; font-size: 18px;\">ung tâm</span><span style=\"background-color: rgb(252, 250, 246); color: rgb(34, 34, 34); font-family: arial; font-size: 18px;\">&nbsp;Y tế huyện Đăk Glong. \"Lực lượng chức năng đã đưa toàn bộ số hành khách về trung tâm y tế huyện để kiểm tra\", ông Thuần nói.</span></p>', 'Trần Hóa', 0, '1/7/2024 16:58:13', 0, 4);
