INSERT INTO `baiviets` (`Id`, `Title`, `Image`, `Description`, `Content`, `Author`, `Hide`, `CreateDate`, `View`, `Id_TheLoaiTin`) VALUES
(161, 'Quảng Nam điều động nhiều cán bộ chủ chốt', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720106844/webtintuc/Qu%E1%BA%A3ng%20Nam%20%C4%91i%E1%BB%81u%20%C4%91%E1%BB%99ng%20nhi%E1%BB%81u%20c%C3%A1n%20b%E1%BB%99%20ch%E1%BB%A7%20ch%E1%BB%91t/noem0g1ugh0vfbp2ojzh.jpg', 'Ông Lê Trí Thanh, nguyên Chủ tịch tỉnh Quảng Nam, được điều động giữ chức Bí thư Đảng đoàn Ủy ban Mặt trận Tổ quốc tỉnh.', '<p class=\"description\" style=\"margin: 0px 0px 15px; text-rendering: optimizelegibility; font-size: 18px; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246)\">Ông Lê Trí Thanh, nguyên Chủ tịch tỉnh Quảng Nam, được điều động giữ chức Bí thư Đảng đoàn Ủy ban Mặt trận Tổ quốc tỉnh.</p>\r\n<article class=\"fck_detail \" style=\" text-rendering: optimizelegibility; width: 680px; float: left; position: relative; font: 400 18px / 28.8px arial; color: rgb(34, 34, 34); background-color: rgb(252, 250, 246)\"><p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px\">Sáng 4/7, Tỉnh ủy Quảng Nam tổ chức hội nghị lần thứ 16 công bố các quyết định về công tác nhân sự. Ông Lê Trí Thanh, nguyên Chủ tịch tỉnh, được điều động đến nhận công tác tại Ủy ban Mặt trận Tổ quốc Việt Nam tỉnh Quảng Nam nhiệm kỳ 2019-2024 và giữ chức vụ Bí thư Đảng đoàn.</p></article>\r\n\n\r\n\n\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%;\" src=\"data:image/jpeg;base64,\" /></div>\r\n\n\r\n<p style=\"text-align: center;\">\n\nÔng Lê Trí Thanh. Ảnh: Đắc Thành</p>\r\n\n\r\n\n\n\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Ông Thanh được giới thiệu hiệp thương tham gia và giữ chức Chủ tịch Ủy ban Mặt trận Tổ quốc Việt Nam tỉnh khóa 10, nhiệm kỳ 2019-2024.</p>\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Ông Lê Trí Thanh 54 tuổi, quê xã Điện Hồng, thị xã Điện Bàn, Quảng Nam, là thạc sĩ chính sách công. Ông từng đảm nhiệm các chức vụ Chủ tịch thị xã Điện Bàn; Trưởng ban Xúc tiến đầu tư và Hỗ trợ doanh nghiệp; Giám đốc Sở Ngoại vụ; Phó bí thư Tỉnh ủy, Chủ tịch tỉnh Quảng Nam.</p>\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Tháng 11/2023, hàng loạt lãnh đạo, cựu lãnh đạo tỉnh Quảng Nam bị Ủy ban Kiểm tra Trung ương kỷ luật từ khiển trách đến khai trừ Đảng. Trong đó, Chủ tịch tỉnh Lê Trí Thanh bị khiển trách. Ông Thanh sau đó xin thôi giữ chức vụ Chủ tịch tỉnh và được miễn nhiệm.</p>\r\n\n\r\n<p style=\"text-align: justify;\"><br /></p>\r\n<p>\n\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\"></p></p>', 'Đắc Thành', 0, '4/7/2024 22:27:21', 0, 1);
INSERT INTO `baiviets` (`Id`, `Title`, `Image`, `Description`, `Content`, `Author`, `Hide`, `CreateDate`, `View`, `Id_TheLoaiTin`) VALUES
(162, 'Lễ hội đánh cá hơn 300 năm', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720107306/webtintuc/L%E1%BB%85%20h%E1%BB%99i%20%C4%91%C3%A1nh%20c%C3%A1%20h%C6%A1n%20300%20n%C4%83m/jtarr6uieozulrvcjlb0.jpg', 'HÀ TĨNH - Tháng 5 âm lịch hàng năm, người dân đổ ra Đầm Vực ở huyện Nghi Xuân tham dự lễ hội đánh cá Đồng Hoa, cầu mong mưa thuận gió hòa, mùa màng bội thu.', '<p>\n\n</p>\r\n<p class=\"description\" style=\"margin: 0px 0px 15px; text-rendering: optimizelegibility; font-size: 18px; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246)\">Tháng 5 âm lịch hàng năm, người dân đổ ra Đầm Vực ở huyện Nghi Xuân tham dự lễ hội đánh cá Đồng Hoa, cầu mong mưa thuận gió hòa, mùa màng bội thu.</p>\r\n<article class=\"fck_detail \" style=\" text-rendering: optimizelegibility; width: 680px; float: left; position: relative; font: 400 18px / 28.8px arial; color: rgb(34, 34, 34); background-color: rgb(252, 250, 246)\"><p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px\">Từ 6h ngày 29/6, hơn 300 người gồm đàn ông, phụ nữ, thanh niên, trẻ em, mang nơm và bì tải, xô nước... đến Đầm Vực ở thôn Nam Viên, xã Xuân Viên, huyện Nghi Xuân tham gia bắt cá. Sau khi các bậc cao niên trong làng Nam Viên và cán bộ xã dâng hương, hoa quả cúng tế Thành Hoàng bản thổ tại ngôi miếu cạnh Đầm Vực, hội đánh cá Đồng Hoa bắt đầu. Tiếng trống lớn vang lên, dòng người từ trên bờ rảo bước nhanh xuống đầm, tiếng cười nói rôm rả cả một vùng.</p><p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px\">Đầm Vực hay Vực Rào là một lạch nước sâu, trải dài theo chân núi Vực, diện tích khoảng 30 ha. Vực có dòng nước trong mát, nhiều hang, đầm lầy, là nơi trú ngụ của các loài cá nước ngọt như chép, lóc, trê, ngạo. Ngoài ra, hàng năm nguồn cá từ các khe Nhà Nương, Tràng Vưng, Bàu Chăm... ở trong huyện Nghi Xuân cũng theo dòng nước đổ về Đầm Vực.</p></article>\r\n\n\r\n<br />\r\n<p></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<p><br /></p>\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%;\" src=\"data:image/jpeg;base64,\" /></div>\r\n<p style=\"text-align: center;\">\n\n<span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; text-align: left; background-color: rgb(252, 250, 246)\">Người dân mang theo ngư cụ đổ về Đầm Vực dự lễ hội đánh cá, sáng 29/6. Ảnh:<span>&nbsp;</span></span><em style=\" text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; font-size: 14px; text-align: left; background-color: rgb(252, 250, 246)\">Đức Hùng</em>\n<br /></p>\r\n<p>\n\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Theo tư liệu lịch sử xã Xuân Viên, để bảo vệ nguồn thủy sản ở Đầm Vực, đầu thế kỷ 18, thời hậu Lê, Hào trưởng Đậu Danh Khiêm (con Đức đại vương Đậu Danh Phương), đỗ Tam trường thời vua Lê Trung Hưng nhưng không theo con đường khoa bảng, về làm Xã trưởng xây dựng quê hương Xuân Viên. Ông Khiêm đã thảo hương ước quản lý làng xã với 5 điều khuyên và 10 điều cấm kỵ, trong đó có \"cấm bắt trộm cá Đầm Vực\".</p><p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Nhằm thắt chặt tình đoàn kết của người dân trong vùng, thúc đẩy sản xuất nông nghiệp, xã trưởng đề xướng tổ chức lễ đánh cá Đồng Hoa tại Đầm Vực, hàng năm chọn một ngày vào dịp trung tuần tháng 5 âm lịch khi mùa màng kết thúc để khai hội. Đánh cá xong, mọi nhà làm lễ cúng cơm mới, trong mâm cơm dâng lên bàn thờ tổ tiên luôn có những con cá vừa bắt được ở Đầm Vực.</p>\n<br /></p>', 'Đức Hùng', 0, '4/7/2024 22:35:3', 0, 2);
INSERT INTO `baiviets` (`Id`, `Title`, `Image`, `Description`, `Content`, `Author`, `Hide`, `CreateDate`, `View`, `Id_TheLoaiTin`) VALUES
(163, 'Lương tối thiểu tăng cao nhất 280.000 đồng mỗi tháng', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720108207/webtintuc/L%C6%B0%C6%A1ng%20t%E1%BB%91i%20thi%E1%BB%83u%20t%C4%83ng%20cao%20nh%E1%BA%A5t%20280.000%20%C4%91%E1%BB%93ng%20m%E1%BB%97i%20th%C3%A1ng/vbbvytz4ctumpkytmhtt.jpg', 'Lương tháng của người lao động trong doanh nghiệp tăng 6%, thêm 200.000-280.000 đồng tùy từng vùng từ ngày 1/7.', '<p>\n\n</p>\r\n<p class=\"description\" style=\"margin: 0px 0px 15px; text-rendering: optimizelegibility; font-size: 18px; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; background-color: rgb(252, 250, 246)\">Lương tháng của người lao động trong doanh nghiệp tăng 6%, thêm 200.000-280.000 đồng tùy từng vùng từ ngày 1/7.</p>\r\n<article class=\"fck_detail \" style=\" text-rendering: optimizelegibility; width: 680px; float: left; position: relative; font: 400 18px / 28.8px arial; color: rgb(34, 34, 34); background-color: rgb(252, 250, 246)\"><p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px\">Ngày 30/6, Chính phủ ban hành Nghị định 74 tăng 6% lương tối thiểu tháng và giờ, căn cứ trên đề xuất của Bộ Lao động Thương binh và Xã hội. Mức tăng được đánh giá \"hài hòa giữa doanh nghiệp và lao động, cơ bản đảm bảo mức sống tối thiểu năm 2025\".</p><p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px\">Lương tối thiểu tháng vùng 1 nâng lên 4,96 triệu đồng; vùng 2 là 4,41; vùng 3 là 3,86 và vùng 4 là 3,45 triệu đồng. Lương hiện hành các vùng đang dao động 3,25-4,68 triệu đồng.</p></article>\r\n\n\r\n<br />\r\n<p><br /></p>\r\n\n\r\n<p><br /></p>\r\n\n\r\n<p><br /></p>\r\n\n\r\n<p><br /></p>\r\n\n\r\n<p><br /></p>\r\n\n\r\n<p><br /></p>\r\n\n\r\n<p><br /></p>\r\n\n\r\n<p><br /></p>\r\n\n\r\n<div style=\"text-align: center;\"><img style=\"max-width: 80%;\" src=\"data:image/jpeg;base64,\" /></div>\r\n\n\r\n<p style=\"text-align: center;\">\n\n<span style=\"color: rgb(34, 34, 34); font-family: arial; font-size: 14px; text-align: left; background-color: rgb(252, 250, 246)\">Lương tối thiểu tháng và giờ tăng 6% từ 1/7. Đồ họa:<span>&nbsp;</span></span><em style=\" text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; font-size: 14px; text-align: left; background-color: rgb(252, 250, 246)\">Đỗ Nam</em>\n<br /></p>\r\n\n\r\n<p>\n\n</p>\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Lương tối thiểu giờ tăng tương ứng 6%, dao động 16.600-23.800 đồng. Cụ thể, vùng 1 lên 23.800 đồng; vùng 2 lên 21.200; vùng 3 lên 18.600; vùng 4 lên 16.600 đồng. Mức hiện hành dao động 15.600- 22.500 đồng.</p>\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Lương giờ được quy đổi tương đương từ lương theo tuần, theo ngày chia cho số giờ làm việc bình thường trong tuần, ngày; hoặc lương theo sản phẩm, lương khoán chia cho số giờ làm việc để sản xuất sản phẩm.</p>\r\n<div id=\"sis_outstream__c\" data-set=\"dfp\" style=\" text-rendering: optimizelegibility; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\"><br /></div>\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Chính phủ quy định lao động được trả lương theo tuần, ngày hoặc sản phẩm thì mức lương quy đổi cũng không thấp hơn lương tối thiểu tháng hoặc tối thiểu giờ.</p>\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Người sử dụng lao động có trách nhiệm rà soát các chế độ trả lương trong hợp đồng thỏa thuận với lao động, thỏa ước tập thể để điều chỉnh cho phù hợp; tiếp tục trả lương đã thỏa thuận, cam kết mà có lợi hơn cho lao động, như cao hơn 7% lương tối thiểu với người làm công việc hoặc chức danh qua đào tạo nghề, 5% với người làm việc trong điều kiện nặng nhọc, nguy hiểm.</p>\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Chủ sử dụng không được bỏ hoặc cắt giảm các chế độ tiền lương với người làm thêm giờ, làm việc ban đêm, bồi dưỡng bằng hiện vật và các chế độ khác.</p>\r\n<p class=\"Normal\" style=\"margin: 0px 0px 1em; text-rendering: optimizespeed; line-height: 28.8px; color: rgb(34, 34, 34); font-family: arial; font-size: 18px; background-color: rgb(252, 250, 246)\">Đây là lần thứ hai trong bốn năm lương tối thiểu vùng tăng vào đầu tháng 7, sau kỳ điều chỉnh hồi 1/7/2022 do ảnh hưởng của Covid-19. Thông lệ hơn 10 năm qua, lương tối thiểu vùng thường tăng vào ngày 1/1. test</p>\r\n\n\r\n<br />', 'Hồng Chiêu', 0, '4/7/2024 22:50:4', 0, 3);
INSERT INTO `baiviets` (`Id`, `Title`, `Image`, `Description`, `Content`, `Author`, `Hide`, `CreateDate`, `View`, `Id_TheLoaiTin`) VALUES
(164, 'Lao động tìm việc nhiều nhưng doanh nghiệp khó kiếm được người', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720109292/webtintuc/test/abjzlbnq04zbu327jbrc.jpg', 'Lao động đang rất nhiều nhưng doanh nghiệp vẫn khó kiếm người, đó là thách thức của thị trường, theo ghi nhận của trang thông tin tuyển dụng Việc làm tốt.', '<p>test</p>', 'Lê Tuyết', 0, '4/7/2024 23:8:12', 0, 3),
(165, 'Nhà máy đối tác Apple tìm lao động chất lượng cao', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720109671/webtintuc/Nh%C3%A0%20m%C3%A1y%20%C4%91%E1%BB%91i%20t%C3%A1c%20Apple%20t%C3%ACm%20lao%20%C4%91%E1%BB%99ng%20ch%E1%BA%A5t%20l%C6%B0%E1%BB%A3ng%20cao/phjthjo9tnyck5jjxsti.jpg', 'Tỷ lệ lao động chất lượng cao chiếm 40% trong tổng số 37.000 vị trí việc làm nửa cuối năm tại Bắc Giang, tập trung tại các nhà máy đối tác của Apple.', '<p>test</p>', 'Hồng Chiêu', 0, '4/7/2024 23:14:29', 0, 3),
(166, 'Ninh Bình chuẩn bị làm cao tốc hơn 6.800 tỷ đồng', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720109801/webtintuc/Ninh%20B%C3%ACnh%20chu%E1%BA%A9n%20b%E1%BB%8B%20l%C3%A0m%20cao%20t%E1%BB%91c%20h%C6%A1n%206.800%20t%E1%BB%B7%20%C4%91%E1%BB%93ng/cskjd4is4pnuos6jf3uw.jpg', 'Hơn 25 km đường thuộc tuyến cao tốc Ninh Bình - Hải Phòng đang hoàn thiện thủ tục đầu tư, dự kiến khởi công cuối năm 2024 và khánh thành sau hai năm.', '<p>test</p>', 'test', 0, '4/7/2024 23:16:40', 0, 4),
(167, 'Những người giữ lửa tranh cử cho ông Biden', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720109894/webtintuc/Nh%E1%BB%AFng%20ng%C6%B0%E1%BB%9Di%20gi%E1%BB%AF%20l%E1%BB%ADa%20tranh%20c%E1%BB%AD%20cho%20%C3%B4ng%20Biden/cfsflabfo5zdspt7so7c.jpg', 'Mỗi khi va vấp trên đường tranh cử, Tổng thống Biden thường nhận được sự hỗ trợ, động viên từ các thành viên gia đình và đồng minh lâu năm. ', '<p>test</p>', 'test', 0, '4/7/2024 23:18:14', 0, 8),
(168, 'Khốn cùng trong cảnh loạn lạc ở Gaza', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720109960/webtintuc/Kh%E1%BB%91n%20c%C3%B9ng%20trong%20c%E1%BA%A3nh%20lo%E1%BA%A1n%20l%E1%BA%A1c%20%E1%BB%9F%20Gaza/smnadd4ad8n8e0fn3ar0.jpg', 'Phát hiện nhóm trộm ắc quy ôtô, Muhammed Abu Karsh đuổi theo, rồi bị bắn chết trên con phố tối om ở Gaza. ', '<p>test</p>', 'test', 0, '4/7/2024 23:19:19', 0, 8),
(169, 'Nhiệm kỳ chủ tịch EU của Hungary', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110228/webtintuc/Nhi%E1%BB%87m%20k%E1%BB%B3%20ch%E1%BB%A7%20t%E1%BB%8Bch%20EU%20c%E1%BB%A7a%20Hungary/lsttb6axdun4ffvfhh5n.jpg', 'Nhiều người lo ngại Hungary có thể tác động tới quyết sách của EU trong 6 tháng nhiệm kỳ chủ tịch luân phiên, song thực tế có thể ngược lại. ', '<p>test</p>', 'test', 0, '4/7/2024 23:23:4', 0, 9),
(170, 'Nga tuyên bố kiểm soát một phần thành trì Chasov Yar', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110394/webtintuc/Nga%20tuy%C3%AAn%20b%E1%BB%91%20ki%E1%BB%83m%20so%C3%A1t%20m%E1%BB%99t%20ph%E1%BA%A7n%20th%C3%A0nh%20tr%C3%AC%20Chasov%20Yar/gdq2shfx0hvceuvtbh5f.jpg', 'Bộ Quốc phòng Nga thông báo lực lượng nước này kiểm soát toàn bộ quận Novy của Chasov Yar, thành trì ở tỉnh Donetsk.', '<p>test</p>', 'test', 0, '4/7/2024 23:26:33', 0, 10),
(171, 'Nga tuyên bố kiểm soát một phần thành trì Chasov Yar', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110395/webtintuc/Nga%20tuy%C3%AAn%20b%E1%BB%91%20ki%E1%BB%83m%20so%C3%A1t%20m%E1%BB%99t%20ph%E1%BA%A7n%20th%C3%A0nh%20tr%C3%AC%20Chasov%20Yar/k7m5q1bodndm0aqfjgnl.jpg', 'Bộ Quốc phòng Nga thông báo lực lượng nước này kiểm soát toàn bộ quận Novy của Chasov Yar, thành trì ở tỉnh Donetsk.', '<p>test</p>', 'test', 0, '4/7/2024 23:26:34', 0, 10),
(172, 'Nhật Bản sẽ thiếu gần 1 triệu lao động nước ngoài vào 2040', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110583/webtintuc/Nh%E1%BA%ADt%20B%E1%BA%A3n%20s%E1%BA%BD%20thi%E1%BA%BFu%20g%E1%BA%A7n%201%20tri%E1%BB%87u%20lao%20%C4%91%E1%BB%99ng%20n%C6%B0%E1%BB%9Bc%20ngo%C3%A0i%20v%C3%A0o%202040/i2cpvdeyiqjkefhf6gfq.jpg', 'Nhật Bản được dự báo cần thêm gần 1 triệu lao động nước ngoài vào năm 2040, nếu muốn đạt các mục tiêu kinh tế trong bối cảnh dân số giảm. ', '<p>test</p>', 'test', 0, '4/7/2024 23:29:42', 0, 11),
(173, 'Jeff Bezos sắp bán 5 tỷ USD cổ phiếu Amazon', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110632/webtintuc/Jeff%20Bezos%20s%E1%BA%AFp%20b%C3%A1n%205%20t%E1%BB%B7%20USD%20c%E1%BB%95%20phi%E1%BA%BFu%20Amazon/o1u9np36rcqxi6a5aqmk.jpg', 'Nhà sáng lập Amazon năm nay liên tiếp bán cổ phiếu công ty, trong bối cảnh mã này lên cao kỷ lục. ', '<p>test</p>', 'test', 0, '4/7/2024 23:30:32', 0, 11),
(174, 'Shopee chơi trội khi cho hủy đơn hàng đang giao', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110720/webtintuc/Shopee%20ch%C6%A1i%20tr%E1%BB%99i%20khi%20cho%20h%E1%BB%A7y%20%C4%91%C6%A1n%20h%C3%A0ng%20%C4%91ang%20giao/c3yauuatl0ulgkhfwfua.jpg', 'Cho khách hủy đơn khi đang trên đường vận chuyển, Shopee tiến thêm bước mới để chiều chuộng người mua nhưng có thể là áp lực mới cho nhà bán.', '<p>test</p>', 'test', 0, '4/7/2024 23:31:59', 0, 12),
(175, 'Cổ phiếu FPT dẫn dắt thị trường', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110790/webtintuc/C%E1%BB%95%20phi%E1%BA%BFu%20FPT%20d%E1%BA%ABn%20d%E1%BA%AFt%20th%E1%BB%8B%20tr%C6%B0%E1%BB%9Dng/zbnitgmyxkb50ulzn1r5.png', 'Chứng khoán duy trì sắc xanh ở phiên thứ tư liên tiếp khi dòng tiền đổ về FPT cùng các mã có câu chuyện riêng, đưa VN-Index sát 1.280 điểm. ', '<p>test</p>', 'test', 0, '4/7/2024 23:33:7', 0, 13),
(176, 'Chứng khoán tăng ba phiên liên tiếp', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110867/webtintuc/Ch%E1%BB%A9ng%20kho%C3%A1n%20t%C4%83ng%20ba%20phi%C3%AAn%20li%C3%AAn%20ti%E1%BA%BFp/fd2iyxafbxodtp9cdvop.jpg', 'VN-Index tăng hơn 7 điểm và dần tiến gần mức kháng cự trước đây khi nhóm cổ phiếu ngân hàng tiếp tục kéo điểm cho thị trường.', '<p>test</p>', 'test', 0, '4/7/2024 23:34:27', 0, 13),
(177, 'Bảo hiểm liên kết đầu tư qua thời tăng nóng', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110930/webtintuc/B%E1%BA%A3o%20hi%E1%BB%83m%20li%C3%AAn%20k%E1%BA%BFt%20%C4%91%E1%BA%A7u%20t%C6%B0%20qua%20th%E1%BB%9Di%20t%C4%83ng%20n%C3%B3ng/gpqmuhsdwp0kcbtwlghi.jpg', 'Doanh thu bán mới bảo hiểm liên kết đầu tư giảm sâu hơn 40% kéo lùi doanh số ngành bảo hiểm 4 tháng đầu năm.', '<p>test</p>', 'test', 0, '4/7/2024 23:35:29', 0, 14),
(178, 'Giá xăng vượt 23.500 đồng một lít', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720110995/webtintuc/Gi%C3%A1%20x%C4%83ng%20v%C6%B0%E1%BB%A3t%2023.500%20%C4%91%E1%BB%93ng%20m%E1%BB%99t%20l%C3%ADt/c0lvdyvich5uln0ntjni.jpg', 'Giá xăng và dầu cùng tăng từ 15h hôm nay, sau điều chỉnh của liên Bộ Công Thương - Tài chính.', '<p>test</p>', 'test', 0, '4/7/2024 23:36:34', 0, 15),
(179, 'Chính phủ ban hành nghị định mới về giá đất', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720111099/webtintuc/Ch%C3%ADnh%20ph%E1%BB%A7%20ban%20h%C3%A0nh%20ngh%E1%BB%8B%20%C4%91%E1%BB%8Bnh%20m%E1%BB%9Bi%20v%E1%BB%81%20gi%C3%A1%20%C4%91%E1%BA%A5t/bnillz6gib6jy60ils2p.jpg', 'Chính phủ hôm nay ban hành Nghị định 71, trong đó quy định cụ thể trình tự, nội dung xác định giá đất.', '<p>test</p>', 'test', 0, '4/7/2024 23:38:18', 0, 16),
(180, 'Kinh doanh bất động sản ở TP HCM ấm trở lại', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720111178/webtintuc/Kinh%20doanh%20b%E1%BA%A5t%20%C4%91%E1%BB%99ng%20s%E1%BA%A3n%20%E1%BB%9F%20TP%20HCM%20%E1%BA%A5m%20tr%E1%BB%9F%20l%E1%BA%A1i/ikbxhswdo05mweb5z8gh.jpg', 'Doanh thu kinh doanh bất động sản tại TP HCM trong nửa đầu năm nay tăng 6% so với cùng kỳ, quý sau cao hơn quý trước.', '<p>test</p>', 'test', 0, '4/7/2024 23:39:37', 0, 17),
(181, 'Novaland đẩy mạnh triển khai loạt dự án', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720111286/webtintuc/Novaland%20%C4%91%E1%BA%A9y%20m%E1%BA%A1nh%20tri%E1%BB%83n%20khai%20lo%E1%BA%A1t%20d%E1%BB%B1%20%C3%A1n/ory1jdftbkhmrt2avrvs.jpg', 'test', '<p>test</p>', 'test', 0, '4/7/2024 23:41:25', 0, 18),
(182, 'Nhà ở Hà Lan nườm nượp khách xem', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720111464/webtintuc/Nh%C3%A0%20%E1%BB%9F%20H%C3%A0%20Lan%20n%C6%B0%E1%BB%9Dm%20n%C6%B0%E1%BB%A3p%20kh%C3%A1ch%20xem/hgm8dg8fkza45ezw4cwe.jpg', 'test', '<p>test</p>', 'test', 0, '4/7/2024 23:44:23', 0, 18),
(183, ' Novaland đẩy mạnh triển khai loạt dự án', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720111511/webtintuc/%20Novaland%20%C4%91%E1%BA%A9y%20m%E1%BA%A1nh%20tri%E1%BB%83n%20khai%20lo%E1%BA%A1t%20d%E1%BB%B1%20%C3%A1n/rnherryygzfj72e9qd1b.jpg', 'test', '<p>test</p>', 'test', 0, '4/7/2024 23:45:10', 0, 18),
(184, 'Novaland đẩy mạnh triển khai loạt dự án', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720111806/webtintuc/Novaland%20%C4%91%E1%BA%A9y%20m%E1%BA%A1nh%20tri%E1%BB%83n%20khai%20lo%E1%BA%A1t%20d%E1%BB%B1%20%C3%A1n/mv0tmh5wu5a5rm6wuboc.jpg', 'test', '<p>test</p>', 'test', 0, '4/7/2024 23:50:6', 0, 18),
(185, 'Có nên bán nhà phố 18 tỷ để mua chung cư và đất nền', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720111887/webtintuc/C%C3%B3%20n%C3%AAn%20b%C3%A1n%20nh%C3%A0%20ph%E1%BB%91%2018%20t%E1%BB%B7%20%C4%91%E1%BB%83%20mua%20chung%20c%C6%B0%20v%C3%A0%20%C4%91%E1%BA%A5t%20n%E1%BB%81n/gen5vk64q3rabcgnij7v.jpg', 'Dòng tiền cho thuê của căn nhà 18 tỷ có thể ít hơn chung cư và đất nền gộp lại nhưng tiềm năng tăng giá mới là yếu tố tạo bứt phá trong gia tăng tài sản, theo chuyên gia.', '<p>test</p>', 'test', 0, '4/7/2024 23:51:26', 0, 19),
(186, '400 triệu, nên mua đất hay kinh doanh đồ điện tử', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720111941/webtintuc/400%20tri%E1%BB%87u%2C%20n%C3%AAn%20mua%20%C4%91%E1%BA%A5t%20hay%20kinh%20doanh%20%C4%91%E1%BB%93%20%C4%91i%E1%BB%87n%20t%E1%BB%AD/xkwbaacjedwk6ymb3mxo.jpg', 'Tôi băn khoăn nên dùng số vốn 400 triệu kinh doanh thiết bị điện tử hay nghe vợ vay thêm để mua mảnh đất giá 1 tỷ đồng ở Quảng Ninh.', '<p>test</p>', 'test', 0, '4/7/2024 23:52:19', 0, 19),
(187, '400 triệu, nên mua đất hay kinh doanh đồ điện tử', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720112069/webtintuc/400%20tri%E1%BB%87u%2C%20n%C3%AAn%20mua%20%C4%91%E1%BA%A5t%20hay%20kinh%20doanh%20%C4%91%E1%BB%93%20%C4%91i%E1%BB%87n%20t%E1%BB%AD/hanjg1pzmtwa0h9dlpdf.jpg', 'test', '<p>test</p>', 'test', 0, '4/7/2024 23:54:27', 0, 19),
