(189, 'Mbappe hết lời ca ngợi Ronaldo trước đại chiến Pháp vs Bồ Đào Nha', 'https://res.cloudinary.com/dvtvl2un6/image/upload/v1720168589/webtintuc/qkdvqislcijosjzrfjyr.webp', 'Mbappe hết lời ca ngợi Ronaldo trước đại chiến Pháp vs Bồ Đào Nha', '<p>\n\n<h2 class=\"content-detail-sapo sm-sapo-mb-0\" style=\"margin: 1.25rem 0px; list-style: none; text-decoration: none; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-weight: 700; font-stretch: inherit; font-size: 1rem; line-height: 1.625rem; font-family: arial; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; color: rgb(64, 64, 64); background-color: rgb(255, 255, 255)\">Kylian Mbappe đã dành những mỹ từ để nói về \"thần tượng\" Cristiano Ronaldo, khi hai người chuẩn bị đối đầu nhau tại tứ kết Euro 2024.</h2><div class=\"maincontent main-content\" id=\"maincontent\" style=\" list-style: none; text-decoration: none; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.75rem; font-family: arial; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; color: rgb(80, 80, 80); background-color: rgb(255, 255, 255); border-collapse: collapse\"><p style=\"margin: 1em 0px 0px; list-style: none; text-decoration: none; font: inherit\"><a href=\"https://vietnamnet.vn/kylian-mbappe-tag16263698367184294895.html\" target=\"_blank\" style=\"list-style: none; text-decoration: underline; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.25rem; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; color: rgb(45, 103, 173); text-underline-offset: 1px; font-size: 18px;\">Mbappe</a><span style=\"font-size: 18px;\">&nbsp;</span><span style=\"font-size: 18px;\">luôn ngưỡng mộ</span><span style=\"font-size: 18px;\">&nbsp;</span><a href=\"https://vietnamnet.vn/cristiano-ronaldo-tag11452587889016286042.html\" target=\"_blank\" style=\"list-style: none; text-decoration: underline; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: 1.25rem; font-family: inherit; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; color: rgb(45, 103, 173); text-underline-offset: 1px; font-size: 18px;\">Ronaldo</a><span style=\"font-size: 18px;\">. Cậu bé lớn lên ở Paris với những tấm hình CR7 dán trên tường. Ngôi sao người Bồ Đào Nha cũng là lý do chính khiến Mbappe mơ ước được khoác áo Real Madrid.</span></p><p style=\"margin: 1em 0px 0px; list-style: none; text-decoration: none; font: inherit\">Đầu hè, Kylian Mbappe đã hoàn tất thương vụ chuyển nhượng sang Bernabeu. Hợp đồng \"bom tấn\" củng cố quan niệm thay đổi đội hình giữa những cầu thủ bóng đá xuất sắc nhất châu Âu qua hai thế hệ.</p></div>\n<br /></p>', 'Trần Hóa', 0, '5/7/2024 15:36:27', 0, 29);
